import React from 'react';
import '../App.css';
import {Button} from 'react-bootstrap';

class Rating extends React.Component {
  constructor(props) {
      super(props);
  }
    render() {
        return (
           <Button variant='light'style={{height: '10%', width: '19%', margin: '1px'}}
            onClick={ () => variant='dark'}>{this.props.rating}</Button>
        )
      }
}

export default Rating
